import React from "react";
import ReactSearchBox from "react-search-box";
class Test extends React.Component {
  data = [
    {
      value: "John Doe",
    },
    {
      value: "Jane Doe",
    },
    {
      value: "Mary Phillips",
    },
    {
      value: "Robert",
    },
    {
      value: "Karius",
    },
  ];
  render() {
    return (
      <div>
        <ReactSearchBox
          placeholder="Placeholder"
          value="Doe"
          data={this.data}
          callback={(record) => console.log(record)}
        />
        <input type="text" placeholder="&#128269; Search" />
      </div>
    );
  }
}

export default Test;
